שלושת השבועות האחרונים היו חוויה מצלקת ומעצבת לכולנו. ביומיים הראושנים מצאתי עצמי משתבלל בבית ולא ממש רוצה לראות נפש חיה ומי שמכיר אותי יודע שאני חיה חברתית. 
למזלי הרב בבוקר היום השלישי מאיה דרין אחותי מגיל שלוש התקשרה וגייסה אותי לשורות בית ספר "בישולים" שאותו היא מנהלת. מעבר לצוות המדהים של השפים, הקונדיטורים, התלמידים והמתנדבים שהתאהבתי בהם. הדברים שעשינו, עשרות אלפי המנות שבישלנו ושלחנו, הספקים המדהימים שנתנו ועדיין נותנים סחורה כדי שנוכל להאכיל את החיילים, המפונים, הילדים והזקנים. כולם שמרו ושומרים על שפיותי בתקופה הקשה הזו ואף יותר מכך, נותנים לי תקווה לעתיד שלא כולו עטוף בזוועות המלחמה. תודה לכם כולכם, תודה על השפיות ועל הקסם שאתם. תודה לבית ספר הזה שמבחינתי הרומן איתו רק החל ותודה הכי גדולה למאיה, אין דברים כמוך ואיזה מזל שאת פה. 
מצורף פה קומץ תמונות קטנטן מהצוות המדהים הזה
